script: |
  super -f tsv -I q10208.sql | sort > q10208.out

vector: true

inputs:
  - name: q10208.sql
    data: |
      SELECT + 12 + COUNT ( * ) + - COUNT ( * ) AS col0 FROM tab2 WHERE NULL NOT BETWEEN + col0 * + col1 AND + CAST ( col0 AS REAL ) * + col2 * 13 * - - col2;
  - name: tab2

outputs:
  - name: q10208.out
    data: |
      12
